INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (221597613523,'The Disney Bear Duffy Elf Costume For 17" Doll w/Mickey Mouse Plush as Elf  ',142,'32908','Verenigde Staten','US','jjsjoj','49.99','USD','Nieuw','img221597613523.jpg','<p align="center"><font face="Georgia" size="6" color="#fb0034"><b>Duffy Holiday Elf Costume</b></font></p><p align="center"><span style="font-size: xx-large;"><font face="Georgia" color="#fb0034"><b>Brand New with Tags</b></font></span></p><p align="center"><font size="6" face="Georgia" color="#fb0034"><b>Disney Theme Parks Authentic</b></font></p><p align="center"><font face="Georgia" color="#fb0034"><b><br></b></font></p><ul style="box-sizing: border-box; margin: 0px; padding: 0px 0px 0px 16px; line-height: 1.416; background-color: rgb(255, 255, 255);"><li><font size="5" color="#fb0034"><b>Costume includes hat, jacket, pants and shoes</b></font></li><li><font size="5" color="#fb0034"><b>Includes Mickey Elf Toy Plush</b></font></li><li><font size="5" color="#fb0034"><b>Self-stick fabric fastener on back of costume</b></font></li><li><font size="5" color="#fb0034"><b>Hat features elastic stretch straps that wrap around Duffy''s ears</b></font></li><li><font size="5" color="#fb0034"><b>Fits 17'''' Duffy Bear Plush Toy, NOT included</b></font></li></ul><div><font color="#222222" size="5"><span style="line-height: 33.984001159668px;"><br></span></font></div><div><div id="ds_div"><div><p align="center" style="text-align: -webkit-center;"><font face="Times New Roman" size="4"><strong>Feedback, Payment, Return and Shipping Policy</strong></font></p><p align="center" style="text-align: -webkit-center;"><font face="Times New Roman" size="4"><strong>FEEDBACK:</strong></font></p><p align="center" style="text-align: -webkit-center;"><font size="4"><b>Please give me 5''s on all categories when leaving feedback.If there is a reason you cannot contact me so we can ensure you are a happy customer. I value my credibility and products sold. I am not a big time ebay seller just a disabled individual trying to make ends meet for my kids and I. If you cannot leave perfect feedback and all 5 ratings please contact me first so issue can be resolved professionally. Negative feedback and less than 5 rating severely hurts my ability to sell by taking away discounts on my fees, placing my items lower on search lists and as a result increasing prices for my buyers. Having all 5''s and positive feedback is a win/win situation for my buyer and myself as it keeps prices down. Majority of my items are the cheapest on ebay as well as the cheapest shipping. Help keep it that way!!!</b></font></p><p align="center" style="text-align: -webkit-center;"><font face="Times New Roman" size="4"><strong>SHIPPING:</strong></font></p><p align="center" style="text-align: -webkit-center;"><font face="Times New Roman" size="4"><strong>I offer first class and priority on my listings weighing less than 13 ounces.&nbsp;<font color="#ff0010"><i>Pl</i></font></strong></font><strong style="font-size: large;"><font color="#ff0010"><i>ease note if you choose first class it is sent in an envelope and depending on USPS care with package once it leaves</i></font></strong><strong style="font-size: large;"><font color="#ff0010"><i>&nbsp;me your package could go through some rough handling and look a little different upon arrival to you vs when I shipped it.&nbsp;</i></font>I try my best to protect it but with first class shipping saving my buyer money this is the "bare bones" of protection in shipping. &nbsp;I WILL NOT SHIP ANYTHING BREAKABLE IN AN ENVELOPE.&nbsp;<i><font color="#ff0010">&nbsp;If you are a collector or this is a gift and you need item to look mint like off a store shelf I recommend paying addi</font></i></strong><strong style="font-size: large;"><i><font color="#ff0010">tional for priority so it is shipped in a box with packing paper or protection. I offer first class options to all my buyers so they can save money.</font></i>&nbsp;I am NOT responsible if the packaging of item or the items arrives bent, creased, smooshed, torn cardboard packaging, etc...&nbsp;</strong></p><p align="center" style="text-align: -webkit-center;"><strong style="font-size: large;">RETURNS:</strong></p><p align="center" style="text-align: -webkit-center;"><strong style="font-size: large;">If there is a defect in product I will always make right and send another one if I have in stock or refund your complete cost once returned. I must have item returned before I will ship another or refund.&nbsp;</strong></p><p align="center" style="text-align: -webkit-center;"><strong style="font-size: large;">If you chose the wrong size or do not want once received I will accept return in MOST cases but reserve the right not to accept return. You must ship back to me and your refund will include purchase price only (never original or return shipping) I will not pay shipping for buyer''s remorse or miscalculation.</strong></p><p align="center" style="text-align: -webkit-center;"><strong style="font-size: large;">PAYMENTS:</strong></p><p align="center" style="text-align: -webkit-center;"><strong style="font-size: large;">Must pay for item within 48 hours or item is relisted and nonpayment is filed. No exceptions.</strong></p></div><br><div style="text-align: center;"><span style="font-family: ''Comic Sans MS''; font-size: x-large;"><font color="#dd1111">International Buyer Outside US</font></span></div><div style="text-align: center;"><font face="Comic Sans MS" size="5" color="#dd1111"><br></font></div><div style="text-align: center;"><font face="Comic Sans MS" size="5" color="#dd1111"><br></font></div><div style="text-align: center;"><font face="Comic Sans MS" size="4" color="#dd1111">I am willing to ship WORLDWIDE.&nbsp;</font></div><div style="text-align: center;"><font face="Comic Sans MS" size="4" color="#dd1111">I love working with my international buyers.&nbsp;</font></div><div style="text-align: center;"><font face="Comic Sans MS" size="4" color="#dd1111">50% of my sales are worldwide outside the US.</font></div><div style="text-align: center;"><font face="Comic Sans MS" size="4" color="#dd1111">&nbsp;I offer gift option and appropriately mark a reduced value to assist with customs.</font></div></div></div>')
