   </FONT></CENTER><BR/><div id="ds_div"><font rwr="1" size="2">Please understand our shipping policy of 3 days handling. &nbsp;We try and ship item as quickly as possible. &nbsp;We may take the 3 days handling and ship on forth day. &nbsp;We do not ship on Saturday or Sunday. Please understand this and accept our apology if this causes a inconvenience. &nbsp;Thank you.</font></div><BR/><span style="font-family: ''Times New Roman''; font-size: small;">Please understand our shipping policy of 3 days handling. &nbsp;We try and ship item as quickly as possible. &nbsp;We may take the 3 days handling and ship on forth day. &nbsp;We do not ship on Saturday or Sunday. Please understand this and accept our apology if this causes a inconvenience. &nbsp;Thank you</span><BR/><p align="center"><strong>Thanks for visiting our store!!</strong></p>
<p align="center"><strong>OUR PRODUCTS</strong></p>
<p align="left"><strong>All of our products are purchased at Estates.&nbsp; MOST of our 
products are used, previously owned, previously displayed.&nbsp; Most of the boxes if 
included show slight to heavy wear.&nbsp; We inspect all of our products before 
offering for sale.&nbsp; The best of use will miss, not see, overlook flaws or 
imperfections.&nbsp; It is our intention to deliver a great product disclosing all 
issues that we see, pictures are a big part of the description and we highly 
suggest you view them and ask questions about the product before bidding.&nbsp; What 
we may have missed,&nbsp;you might see.&nbsp; That senario has happened.&nbsp; </strong></p>
<p align="center"><strong>OFFERS</strong></p>
<p align="left"><strong>We appreciate your shopping with us.&nbsp; However, we will not 
accept offers on any of our products.&nbsp; If we want to deal on a product, we will 
have a best offer on the listing.&nbsp; If you send a offer, please don''t be 
offended.&nbsp; It will not be replyed.</strong></p>
<p align="center"><strong>Combined Shipping</strong></p>
<p align="left"><strong>We do offer combined shipping.&nbsp; Our "Combined Shipping" 
policy is to ship the products purchased based on weight of final package to 
your zip code.&nbsp; You may want to wait until we send a invoice with updated 
shipping charges, before paying.</strong></p>
<p align="center"><strong>Shipping</strong></p>
<p align="left"><strong>It is our store policy that we have 3 days handling.&nbsp; We 
do not ship on Saturdays and Sundays.&nbsp; This means that we will ship on the forth 
day in rare cases.&nbsp; In some instances if you buy something on a Wednesday it may 
not go out until the next Monday.&nbsp; Please be aware of this before bidding.&nbsp; If 
you are in a hurry to get something, please note our shipping policy.&nbsp; 
</strong></p>
<p align="center"><strong>Returns</strong></p>
<p align="left"><strong>We will gladly accept returns if there was damage due to 
shipping or we didn''t disclose information.&nbsp; Pictures are a HUGH part of the 
