bidding.&nbsp; We WILL NOT accept returns&nbsp;for reasons such as, it wasn''t what you 
thought, The color was off, or any other reason.&nbsp; Should you find that it was 
damaged, we would Kindly like a COURTESY&nbsp;Email with your concerns before leaving 
any kind of feed back, Good or Bad.&nbsp; We want to know if WE did something wrong 
and what we could have done better, often times remedying the situation, most of 
the time in your favor.&nbsp; We strive to give great service and find it unsettling 
that someone could leave negative feedback without any communication.&nbsp; 
</strong></p>
<p align="center"><strong>We greatly appreciate ALL of our customers and have 
