<p align="justify"><b><font face="Verdana" size="3" color="#AD0000">Description:<br>
<br>
</font></b><font size="2" face="Verdana"><p align="center">
	<font face="arial" size="5">These hand painted, porcelain figurines come 
from France. They are made to be put inside a "King Cake" for the "Epiphany" 
Holiday, this holiday is celebrated every year on January 6th, the 12th day of 
Christmas. Tradition states that this is the day that the three wise men or 
"Three Kings" came to Bethlehem, to honour the birth of Christ. A long running 
tradition in France is to bake a "King Cake", and insert a Fava bean inside the 
cake. More recently, this bean has been replaced by a ceramic figure. The word 
"Feve" is French for Fava bean. The child who finds the figure in his or her 
slice, is king for the day. This tradition has been commercialized, and there is 
a very wide assortment of porcelain and gold figures that are made for the 
Epiphany. They go by several names, King Cake figures, Epiphany figures, or 
"Feves". All feves of licensed figures are authorized by the copyright owner.</font></p>
<p align="center"><font face="Arial" size="5">****</font></p>
<p align="center"><font face="arial" size="5">These are all characters from the Disney film Peter Pan.</font></p>
<p align="center"><font face="arial" size="5">They are in good condition, with no chips, or cracks.</font></p>
<p align="center"><font face="arial" size="5">The tallest measures just 35mm high (about 1.5 inches)</font></p>
<p align="center">
	<font size="5">****</font></p>
<p align="center">&nbsp;</p>
<p align="center">
	</p>
<p align="center">
	&nbsp;</p>
<p align="center">
	<font size="5">HINTS AND TIPS</font></p>
<p align="center">
	<font size="5">Just a few little tips that might make life easier.</font></p>
<p align="center">
	<font size="5">*****</font></p>
<p align="center">
	<font size="5">Buyers outside the UK must pay by Paypal. UK buyers may also&nbsp;pay by cheque or postal order if they wish.</font></p>
<p align="center">
	<font size="5">*****</font></p>
<p align="center">
	<font size="5">If you buy more than one item I will combine them and discount postage wherever possible.</font></p>
<p align="center">
	<font size="5">****</font></p>
<p align="center">
	<font size="5">If you are going to be away, or wish to delay payment for any reason, do let me know, and I can put a note on your stuff so that you won''t get an unpaid item dispute.</font></p>
<p align="center">
	<font size="5">*****</font></p>
<p align="center">
	<font size="5">If you are unhappy with your purchase please tell me, I''m not perfect, and I sometimes make mistakes.</font></p>
<p align="center">
	<font size="5">*****</font></p>
<p align="center">
	<font size="5">I always post promptly, usually within 24 hours of payment,&nbsp;so if your parcel does not arrive within&nbsp;three or&nbsp;four working* days&nbsp;you should contact your local DELIVERY OFFICE as I frequently have items returned that haven''t been collected&nbsp;(*don''t forget that Sundays and bank holidays don''t count, and that overseas mail will take&nbsp;up to 12&nbsp;days for Europe, and&nbsp;up to 21&nbsp;days for US, Australia etc).</font></p>
<p align="center">
	<font size="5">*****</font></p>
<p align="center">
	<font size="5">Thank you, and happy bidding.....Janet</font></p>
<p align="center">
	<font size="5">*****</font></p>
<p align="center">
	<font size="5">Other stuff you need to know</font></p>
<p align="center">
	<font size="4">&nbsp;I post airmail. I will not send items overseas by surface mail. I will email you when your order is dispatched. Postage is as stated in the description. If you require next day delivery, recorded, Airsure or International Signed For, then please contact me first. This service will be provided at an additional cost added to your invoice.<br />
	&nbsp;<br />
	VAT<br />
	I am not VAT registered so there will be no additional charge for this.<br />
	&nbsp;<br />
	INTERNATIONAL BUYERS - PLEASE NOTE<br />
	Import duties, taxes and charges are not included in the item price or shipping cost. These charges are the buyers responsibility. Please check with your country&rsquo;s customs office to determine what these additional costs will be prior to buying.<br />
	&nbsp;<br />
	&nbsp;<br />
	RETURNS<br />
	In the unlikely event that you wish to return an item simply email me first, and then return it in good condition within 14 days, using the same packaging, and I will&nbsp;give you&nbsp;a full refund. Return postage is the responsibility of the buyer.</font></p>
<p align="center">
	&nbsp;</p><br>
<br>
</font><b><font face="Verdana" size="3" color="#AD0000">Shipping :<br>
<br>
</font></b><font size="2" face="Verdana">I will ship items within two business days of receipt of cleared funds.<br>
<br>
</font><b><font face="Verdana" size="3" color="#AD0000">Payment :<br>
<br>
</font></b><font size="2" face="Verdana">I accept paypal for all items. Buyers outside of the UK must pay by paypal, in pounds sterling. Buyers in the UK may also pay by personal cheque, bankers draft or postal order. Please note : I must allow 7 business days for clearance of personal cheques.<br>
</font></td>
