<p class="MsoBodyText"><b style="mso-bidi-font-weight:normal"><span style="font-size:11.0pt;mso-bidi-font-size:12.0pt">Privatsphäre und Datenschutz</span></b></p>

<p class="MsoBodyText"><span style="font-size:11.0pt;mso-bidi-font-size:12.0pt">Ich
verwende Ihre Bestandsdaten ausschließlich zur Abwicklung Ihrer Bestellung.
Alle Kundendaten werden unter Beachtung der einschlägigen Vorschriften des
Telemediengesetzes ( TMG ) von mir gespeichert und verarbeitet. Sie haben
jederzeit ein Recht auf kostenlose Auskunft, Berichtigung, Sperrung und
Löschung Ihrer gespeicherten Daten. Bitte wenden Sie sich an mich per e-Mail
oder senden Sie mir Ihr Verlangen per Post oder Fax. Ich gebe Ihre
personenbezogenen Daten einschließlich Ihrer Hausadresse nicht ohne Ihre ausdrückliche
und jederzeit widerrufliche Einwilligung an Dritte weiter. Ausgenommen hiervon
sind meine Dienstleistungspartner, die zur Bestellabwicklung die Übermittlung
von Daten benötigen ( z.B.Verkäufertools ), das mit der Lieferung beauftragte
Versandunternehmen und das mit der Zahlungsabwicklung beauftragte
Kreditinstitut. In diesem Fällen beschränkt sich der Umfang der übermittelten
Daten jedoch nur auf das erforderliche Minimum. Ich setze technische und
organisatorische Sicherheitsmaßnahmen ein, um Ihre durch mich verwalteten Daten
gegen zufällige Manipulationen, Verlust, Zerstörung oder gegen den Zugriff
unberechtigter Personen zu schützen.</span></p>

