INSERT Items(ID,Titel,Categorie,Postcode,Locatie,Land,Verkoper,Prijs,Valuta,Conditie,Thumbnail,Beschrijving) VALUES (121468379846,'NIB RARE Disney Mickey Mouse Through the Years "Ears" Snow Globe with Lights Up',13846,'43015','Verenigde Staten','US','mennda01','249.97','USD','Nieuw','img121468379846.jpg','<center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font <font="" color="#923397"><b>RARE In the Box Mickey Mouse Through the Years<b></b></b></font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font <font="" color="#923397"><b>Musical Light Up "Ears" Snow Globe</b></font></center><center style="font-family: Arial, Helvetica, sans-serif; font-weight: bold; background-color: rgb(255, 255, 255);"><br></center><center style="font-family: Arial, Helvetica, sans-serif; font-weight: bold; background-color: rgb(255, 255, 255);"><span style="color: rgb(146, 51, 151);">The original tag &amp; stickers are still on it.</span></center><center style="font-family: Arial, Helvetica, sans-serif; font-weight: bold; background-color: rgb(255, 255, 255);"><span style="color: rgb(146, 51, 151);">Comes with original box and styrofoam</span></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">The globe is made of glass with a set of plastic "ears".</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397"><br></font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">The 2 post lamps above The Walt Disney Studios sign</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">light up with the flip of a switch.&nbsp;</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397"><br></font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">Batteries were not kept in the</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">snowglobe during it''s shelf life.&nbsp;</font><span class="Apple-style-span" style="color: rgb(146, 51, 151);">Requires 2 "AA" Batteries.</span></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><br></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397"><br></font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">Plays the "Mickey Mouse Club March" by Dodo Jimmie</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397"><br></font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><span class="Apple-style-span" style="color: rgb(146, 51, 151);">The globe features Mickey Mouse characters from</span></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">4 Walt Disney Classic Animated Films</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">Steamboat Willie 1928</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">The Band Concert 1935</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">Brave Little Tailor 1938</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397">Fantasia 1940</font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font class="Apple-style-span" color="#923397"><br></font></center><center style="font-family: Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);"><font color="#923397">Thanks for looking and please let me know if you have any questions!</font></center>')
