GENERAL &amp; TECHNICAL INFORMATION:</b>
</p><p>
All my decals are custom made by me and are intended to go on vehicles, though it is possible to place them on other clean, flat, smooth, non-porous, and non-textured surfaces. Glass surfaces work the best, as well as car bodies. Decal is NOT re-usable, one time use only. I have several colors to choose from, customer may choose the color of their liking. I will include instructions on how to work with and place the stickers, pretty simple.
</p><p>
Decals are individual, they are not connected together on a single sheet - and they do not include a background. All my available colors are glossy, they are not matte. Depending on climate, environment, how well they are taken care of, elements they are exposed to, the ''outdoor'' life of the vinyl can be from 4 to 5 years (intermediate calendered vinyl, brand name: Oracal 651). If placed indoors, they are better protected and can last much longer.
