			<div class="row-fluid" id="information">
			
				<div id="shipping" class="block" onclick="toggleContent(this.id)">
					<h3>Versandinformation</h3>
					<div class="block-content" id="shipping-content">
						<h4>Paketlieferung</h4>
						<p>Ihre Bestellung wird von uns fachkundig und transportsicher verpackt und Ihnen durch renommierte Paketdienstleister zugestellt. Wir arbeiten ausschließlich mit Paketdienstleistern, die sich qualitativ bewiesen haben und über ein breites Filialnetz verfügen. Sollten Sie einmal nicht zuhause angetroffen werden, wird Ihnen die Sendung an einem anderen Tag zugestellt oder über eine Benachrichtigungskarte in einer Paketfiliale in Ihrer unmittelbarer Wohnnähe deponiert.</p>
						<h4>Bücher- und Warensendungen (Sparversand)</h4>
						<p>Ihre Bestellung wird Ihnen in einem luftpolstersicheren Kuvert mit sehr stabilen Stoßschutz zugestellt. Da nicht alle Artikel über diese Versandart verschickt werden können (aufgrund von Größe und Gewicht), haben wir Ihnen diese Versandoption bereits bei den dafür geeigneten Artikeln hinterlegt. </p>
						<h4>Lieferungen an Packstationen</h4>
						<p>Lieferungen an Packstationen unterliegen einem Pakethöchstmaß von 60 x 35 x 35cm. Sollte Ihre Bestellungen von dem Höchstmaß abweichen, werden wir Sie in einer separaten Nachricht darüber in Kenntnis setzen. In diesem Fall teilen Sie uns bitte Ihre Hausadresse mit.</p>
						<h4>Paket-Flatrate</h4>
						<p>Grundsätzlich zahlen Sie für jede Bestellung nur einmal Versandkosten, unabhängig von der Anzahl Ihrer gekauften Artikel. Dies ist auch der Fall, wenn Sie verschiedenartige Artikel kaufen. Warten Sie nach Ihrem Kauf einfach unsere Zahlungsinformation ab, dann haben Sie es bei der Zahlungsanweisung leichter.</p>
						<p>Die Paket-Flatrate ist nicht auf Bücher- und Warensendungen anwendbar. Hier ist ein kombinierter Versand nur möglich, wenn die Sendungsgröße und das Sendungsgewicht das von der Deutschen Post hinterlegte Höchstmaß nicht überschreitet.</p>
						<h4>Internationaler Versand (Worldwide shipping)</h4>
						<p>International bidders are welcome. We offer a fair shipping charge (insurance is included) around the world. Most of our articles can combined shipped in one package, so you have to pay freight only once. Please wait for our payment instruction after buying.</p>
					</div>
				</div>
				
				<div id="payment" class="block" onclick="toggleContent(this.id)">
					<h3>Zahlungsinformation</h3>
					<div class="block-content" id="payment-content">
						<h4>Paypal, Banküberweisung und Barzahlung </h4>
						<p>Zahlen Sie einfach und bequem mit paypal oder per Banküberweisung. Sobald eine Gutschrift auf einem unserer beiden Konten erfolgt, wird die Versandabwicklung unmittelbar angestoßen. Verwenden Sie hierfür im Idealfall den ebay-Zahlungsassistenten, der Ihnen nach jedem Kauf angezeigt wird. Bei Banküberweisungen teilen Sie uns bitte Ihren ebay-Namen mit.</p>
						<p>Sie können Ihre Bestellung auch persönlich in unserem Versandlager Hockenheim abholen und vor Ort den ebay-Kaufpreis in bar entrichten. Vereinbaren Sie hierzu einen Abholtermin mit unserem Kundenservice.</p>
					</div>
				</div>
				
				<div id="feedback" class="block" onclick="toggleContent(this.id)">
					<h3>Bewertungen</h3>
					<div class="block-content" id="feedback-content">
						<p>Eine positive Bewertung, sowie die Vergabe von 5 Sternen in allen Punkten, ist für ein kleines Unternehmen wie uns unverzichtbar. Wenn Sie also mit Ihren Artikeln zufrieden sind, bewerten Sie Ihren Kauf bitte mit 5 von 5 Sternen, denn bei einer Bewertung mit nur 4 von 5 Sternen wird der Kauf von eBay als negativ eingestuft.</p>
						<h4>Menschen machen Fehler...</h4>
						<p>...und wo gehobelt wird, da fallen Späne! Obwohl wir unseren Job wirklich lieben und täglich unser Bestes geben, kann es in ganz wenigen Ausnahmefällen leider doch einmal passieren, dass etwas nicht so klappt wie es hätte sein sollen. Natürlich sind Sie (wie auch wir) kurzzeitig darüber verärgert, aber nichts ist unlösbar. Unser Kundenservice hat bislang schon immer die richtigen Lösungen parat gehabt, so dass wir unsere Kunden auch dann noch begeistern konnten. </p>
						<p>Geben auch Sie uns die Möglichkeit dazu, wenn einmal Sand im Getriebe ist. Nichts ist beabsichtigt, alles ist menschlich. Informieren Sie uns rechtzeitig und schildern Sie uns das Problem. Wir lösen es und Sie können uns mit ruhigem Gewissen positiv bewerten.</p>
						<h4>Ärger mit der Anlieferung...</h4>
						<p>...hatten wir alle schon einmal. Im Paketdienstleistungsbereich werden täglich hunderttausende Pakete versendet und viele Menschen sind an der logistischen Abwicklung beteiligt. Obwohl unsere Paketdienstleister jedes Jahr ein hohes Maß an Kundenzufriedenheit erreichen, passieren auch dort manchmal Dinge, die es nicht geben sollte. </p>
						<p>Bitte sprechen Sie uns auch in diesem Fall darauf an, wenn einmal etwas nicht zu Ihrer Zufriedenheit funktioniert. Wir schalten uns dann ein und sorgen für die richtigen Lösungen. Bedenken Sie bei Ihrer anschließenden Bewertung ebenfalls, dass wir keinerlei Profit mit den Portopreisen unserer Kunden erzielen. Wir sehen uns als Handelsunternehmen und nicht als Paketdienstleister. Wir möchten es so wie Sie: Dass es läuft!</p>

                                                ##425906##

					</div>
				</div>
				
