					<h3>Kaufabwicklung</h3>
					<div class="block-content" id="buyers-guide-content">
						<p>Nutzen Sie den ebay-Zahlungsassistenten, der Ihnen nach jedem Kauf automatisch angezeigt wird. Folgen Sie den Instruktionen und in wenigen Augenblicken erhalten Sie alle notwendigen Informationen, die Sie für die Zahlung an uns benötigen.</p>
						<p>Wir bestätigen anschließend den Erhalt Ihrer Zahlung und benachrichtigen Sie, sobald Ihre Bestellung auf dem Weg zu Ihnen ist. Sollten Sie dennoch Fragen haben, so rufen Sie uns an oder schreiben Sie uns.</p>
