						<p>Im Zusammenhang mit dem Vertrieb von Batterien und Akkus sind wir als Händler gemäß Batterieverordnung verpflichtet, Sie als Verbraucher auf folgendes hinzuweisen:</p>
						<p>Sie sind gesetzlich verpflichtet, Batterien und Akkus zurückzugeben. Sie können diese nach Gebrauch in unserer Verkaufsstelle, in einer kommunalen Sammelstelle oder auch im Handel vor Ort zurückgeben. Schadstoffhaltige Batterien sind mit einem Zeichen, bestehend aus einer durchgestrichenen Mülltonne und dem chemischen Symbol (Cd, Hg oder Pb) des für die Einstufung als schadstoffhaltig ausschlaggebenden Schwermetalls versehen.</p>
