<p class="MsoNormal"><span style="font-size:13.0pt;font-family:&quot;Trebuchet MS&quot;;
mso-bidi-font-family:&quot;Trebuchet MS&quot;;color:#262626">FOR SALE WE ARE SELLING A USED DISNEY POOH STUCK IN THE HONEY POT SNOW GLOBE, PLAYS RUMBLY IN MY TUMBLY.THIS LOOKS TO BE IN GOOD CONDITION &nbsp;AND WAS PART OF AN ADULT COLLECTION AND A SMOKE FREE HOME.DOES NOT COME WITH ORIGINAL BOX .FROM 2002</span></p><p class="MsoNormal"><span style="font-size:13.0pt;font-family:&quot;Trebuchet MS&quot;;
mso-bidi-font-family:&quot;Trebuchet MS&quot;;color:#262626"><br></span></p><p class="MsoNormal"><span style="font-size:13.0pt;font-family:&quot;Trebuchet MS&quot;;
mso-bidi-font-family:&quot;Trebuchet MS&quot;;color:#262626"><br></span></p><p class="MsoNormal"><span style="font-size:13.0pt;font-family:&quot;Trebuchet MS&quot;;
mso-bidi-font-family:&quot;Trebuchet MS&quot;;color:#262626">Winnie the Pooh<o:p></o:p></span></p>

<p class="MsoNormal"><span style="font-size:13.0pt;font-family:&quot;Trebuchet MS&quot;;
mso-bidi-font-family:&quot;Trebuchet MS&quot;;color:#262626">Description: Pooh has gotten
his head stuck in the hunny pot. Piglet tries to help him out of his sticky
