<P align=center><BR><!-- PRODUKTBESCHREIBUNG //--><B>Auto Sammelfigur <BR><BR>Disney Cars 2 <BR><BR><FONT color=#ff0000>"Max Schnell" <BR></FONT><BR>Größe in mm: L 76, B 36, H 27 <BR><BR>Original Bullyland Lizenzware</B> <BR><BR>aus Kunststoff - PVC frei - Räder nicht beweglich <BR><BR>Mit viel Liebe naturgetreu gestaltet, <BR>mit vielen Details von Hand bemalt, <BR>nach internationalen Sicherheitsstandards gefertigt, <BR>mehrfach ausgezeichnet für besondere Qualität. <BR><BR><B>Max Schnell war zunächst nur eine einfache Personenlimousine. Der eifrige Amateur-Rennfahrer feilte jedoch auf eigene Faust an seinen Künsten auf den wenig befahrenen Landstraßen des Landes. Dabei stach er letzten Endes auch dem Besitzer eines Rennteams ins Auge. Bald bestritt Max seine ersten Rennen als Profi, stets mit der Nummer 4 auf seiner Motorhaube. Beständig nahmen seine Pferdestärken zu und er selbst streifte seine alte Hülle und überflüssiges Gewicht ab, um künftig auf Kohlenstofffaser zu setzen und perfekt in Rennform zu kommen. Er hat mehr Rennen auf dem Motorring gewonnen als irgendein anderes Auto in der Geschichte der World Torque Champion League. Max ist ein von Natur aus brillanter Ingenieur. Er setzte auf Logik und Analyse, um sich neu zu erfinden und konkurrenzfähig zu machen. Genauso will er auch in den World Grand Prix gehen – kühl und perfekt kalkulierend. <BR>© Disney/Pixar</B> <BR><BR><FONT size=2>Achtung! Nicht geeignet für Kinder unter 3 Jahren, wegen Erstickungsgefahr durch Kleinteile!<!-- /PRODUKTBESCHREIBUNG //--><BR></FONT><BR></FONT></P></SPAN></TD>
